import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navigation from './Navigation';

const Home = () => <h2>Home</h2>;
const Introduction = () => <h2>Introduction</h2>;

// Основные темы
const ConditionalsLoops = () => <h2>Conditionals and Loops</h2>;
const FunctionsModules = () => <h2>Functions and Modules</h2>;

// Подтемы и уроки
const Conditionals = () => <h2>Conditionals</h2>;
const Loops = () => <h2>Loops</h2>;
const WhileLoop = () => <h2>While Loop</h2>;
const ForLoop = () => <h2>For Loop</h2>;

const Functions = () => <h2>Functions</h2>;
const Modules = () => <h2>Modules</h2>;

const App = () => {
  return (
    <Router>
      <Navigation />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/introduction" element={<Introduction />} />
        <Route path="/conditionals-loops" element={<ConditionalsLoops />} />
        <Route path="/conditionals" element={<Conditionals />} />
        <Route path="/loops" element={<Loops />} />
        <Route path="/loops/while-loop" element={<WhileLoop />} />
        <Route path="/loops/for-loop" element={<ForLoop />} />
        <Route path="/functions-modules" element={<FunctionsModules />} />
        <Route path="/functions" element={<Functions />} />
        <Route path="/modules" element={<Modules />} />
      </Routes>
    </Router>
  );
};

export default App;
